import './ExpenseItem.css'

const ExpenseItem = () => {
    const expenseTitle = 'Car Insuranse'
    const expenseDate = new Date(2022, 11, 19).toString()
    const expensePrice = 200
  return (
        <div className='expense-item'>
            <div className='expense-item__description'>{expenseTitle}</div>
            {/* <h2>{expenseDate}</h2> */}
            <div className='expense-item__prise'>${expensePrice}</div>
        </div>
    )
};

export default ExpenseItem;
